import { useEffect, useState } from "react";
import Footer from "../../components/Header&Footer/Footer";
import Header from "../../components/Header&Footer/Header";
import "./Planets.scss";
import PlanetCards from "../../components/Planetcards/PlanetCards";
interface IPlanets {
    name: string;
    climate:string;
    diameter:string;
    gravity:string;
    orbital_period:number;
    population:number;
    terrain:string
  }

const Planets:React.FC = () => {
  const [plantesData, setPlanetsData] = useState<IPlanets[]>([]);
  const [nextPage, setNextPage] = useState<string | null>(null);
  const planetsUrl = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://upload.wikimedia.org/wikipedia/en/thumb/d/d2/Hothplanetsurface.jpg/330px-Hothplanetsurface.jpg",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
  ];

  const getPlanets = async (url: string) => {
    const response = await fetch(url);
    if (response.ok) {
      const data = await response.json();
      setPlanetsData([...plantesData, ...data.results]);
      setNextPage(data.next);
    }
  };

  useEffect(() => {
    const initialUrl = "https://swapi.dev/api/planets";
    getPlanets(initialUrl);
  }, []);

  const loadMorePeople = () => {
    if (nextPage) {
      getPlanets(nextPage);
    }
  };

  return (
    <>
      <Header />

      <section className="planets">
        <div className="planetsContainer">
          <p className="planetsParagraf">Planets</p>
          <div className="planetsGridBox">
            {plantesData.map((planet: any, index: number) => (
              <div key={index}>
                <PlanetCards
                  url={planetsUrl[index % planetsUrl.length]}
                  name={planet.name}
                  climate={planet.climate}
                  diameter={planet.diameter}
                  gravity={planet.gravity}
                  orbital_period={planet.orbital_period}
                  population={planet.population}
                  terrain={planet.terrain}
                />
              </div>
            ))}
          </div>
        </div>

        {nextPage && (
          <div className="load">
            <button className="loadMoreButton" onClick={loadMorePeople}>
              Load more
            </button>
          </div>
        )}
      </section>

      <Footer />
    </>
  );
};
export default Planets;
